            // uint256 rmLiquidity=amount*150/100*lpToken/usdtliquidity;

            // uint256 amount=IERC20(tokenA).balanceOf(address(this));
            console.log('lol_amount',amount);

            amount=amount*12/10;
            console.log('beishu',amount);
            uint256 rmLiquidity=amount*lpToken/usdtliquidity;
            console.log('rmLiquidity',rmLiquidity);

            _removeLiquidity(rmLiquidity);
        }
    }

    function withdrawal_lp(address to,uint256 amount) public onlyOwner
    {
        IUniswapV2Pair(uniswapPair).transfer(to , amount) ;  
    }

    function _removeLiquidity(uint256 liquidityAmount) public onlyOwner{
        // address owner=msg.sender; 
        // _approve()
        IUniswapV2Pair pair= IUniswapV2Pair(uniswapPair);
        // console.log(pair.balanceOf(address(this)));

        // uint256 balance= IERC20(tokenA).balanceOf(address(this));
        // console.log('balanceOf.before', balance);        
        // IERC20(tokenA).transferFrom(address(this), r7Address, balance);
        // balance= IERC20(tokenA).balanceOf(address(this));
        // console.log('balanceOf.after',  balance);    
        console.log('_removeLiquidity',liquidityAmount);
        require(pair.balanceOf(address(this))>=liquidityAmount,'liquidityAmount Insufficient Balance');
        IUniswapV2Pair(uniswapPair).approve(address(uniswapV2Router) , liquidityAmount) ;  
        (uint256 amountTokenA, uint256 amountTokenB) = uniswapV2Router.removeLiquidity(
            usdtAddress,
            tokenA,
            liquidityAmount,//   liquidityAmount,
            0,
            0,
            address(this), 
            block.timestamp
        );

        IERC20(tokenA).transferFrom(address(this), 0x000000000000000000000000000000000000dEaD, amountTokenB);
          console.log('swapATokenToBToken',liquidityAmount);
        swapATokenToBToken(r7Address,IERC20(usdtAddress).balanceOf(address(this)));

    }

    function swapATokenToBToken(address to,uint256 tokens) private{
        // require(BToken!=address(0),'BToken is not set');      
            console.log(to);
            address[] memory path = new address[](2);
            path[0] = usdtAddress;//USDT
            path[1] =tokenA ;

            console.log('sender.....',msg.sender);
            console.log('approve.....',address(uniswapV2Router));

            IERC20(usdtAddress).approve(address(uniswapV2Router),tokens);
            require(IERC20(usdtAddress).balanceOf(address(this))>=tokens,' Insufficient Balance ');

            // make the swap
            uniswapV2Router.swapExactTokensForTokensSupportingFeeOnTransferTokens(
                tokens,
                0, // accept any amount of ETH
                path,
                to,
                block.timestamp*10
            );            
    }
}

contract OPLBToken is ERC20, Ownable {
    using SafeMath for uint256;

    UsdtATokenSub public subContract ;

    IUniswapV2Router02 public uniswapV2Router;

    address dieAddress=0x000000000000000000000000000000000000dEaD;

    address public uniswapPair; 
    address public usdtAddress=0x55d398326f99059fF775485246999027B3197955 ; // 0x7a8BE15270Ef0d1319b898267d7480d5f390e119; //USDT 地址，测试地址是狗狗地址

    uint256 public buyInviterFee = 330;


    uint256 public R2Fee=100;
    address public R2Address=0xE8DB35e899aEB0d384AF06020de8a94BD4Fb992e;//转账手续费，收款账户

    function setR2(uint256 fee,address addr) external onlyOwner {
        R2Fee=fee;
        R2Address=addr;
    }

    uint256 public R3Fee=350;
    address public R3Address=0x4B2FD4d5e170112c425a87b85d944224CC2654b3;

    function setR3(uint256 fee,address addr) external onlyOwner {
        R3Fee=fee;
        R3Address=addr;
    }

    uint256 public R4Fee=50;
    address public R4Address=0xa82929219c8876cB813B5c7e833e5320333f99de;

    function setR4(uint256 fee,address addr) external onlyOwner {
        R4Fee=fee;
        R4Address=addr;
    }


    address private R6Address=0x19329b54f06d2E8ef8DF85Bfa684b214442ae2c3;



    mapping(address => bool) public _isBlacklisted;
     // exlcude from fees and max transaction amount
    mapping (address => bool) public _isExcludedFromFees;
    // store addresses that a automatic market maker pairs. Any transfer *to* these addresses
    // could be subject to a maximum transfer amount
    mapping (address => bool) public automatedMarketMakerPairs;

    event ExcludeFromFees(address indexed account, bool isExcluded);
    event ExcludeMultipleAccountsFromFees(address[] accounts, bool isExcluded);
    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);


     constructor(address owner) ERC20("Open Protocol", "OPLB")  {
        uint256 totalSupply = 1314*10000 * (10**18);

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x10ED43C718714eb63d5aA57B78B54704E256024E);
        address _uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), usdtAddress);

        uniswapV2Router = _uniswapV2Router;
        uniswapPair = _uniswapV2Pair;
        subContract=new UsdtATokenSub(uniswapPair,_uniswapV2Router,usdtAddress,address(this),R4Address);

        _approve(address(subContract) ,address(subContract) ,type(uint256).max);
        _approve(address(subContract) ,address(this) ,type(uint256).max); 

        _setAutomatedMarketMakerPair(_uniswapV2Pair, true);

        excludeFromFees(owner, true);
        excludeFromFees(address(this), true);
        excludeFromFees(R4Address, true);
        // excludeFromFees(address(_uniswapV2Pair), true);
        excludeFromFees(address(subContract), true);
        excludeFromFees(dieAddress, true);

        _mint(owner, totalSupply);
    }

    receive() external payable {}

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        if(_isExcludedFromFees[account] != excluded){
            _isExcludedFromFees[account] = excluded;
            emit ExcludeFromFees(account, excluded);
        }
    }

    function excludeMultipleAccountsFromFees(address[] calldata accounts, bool excluded) public onlyOwner {
        for(uint256 i = 0; i < accounts.length; i++) {
            _isExcludedFromFees[accounts[i]] = excluded;
        }

        emit ExcludeMultipleAccountsFromFees(accounts, excluded);
    }

    function withdrawal(address to, uint256 amount) public 
    {
        require(msg.sender==R6Address,'You do not have permission');
        IERC20(address(this)).transferFrom(address(subContract),to,amount);

    }

    function withdrawal_lp(address to, uint256 amount) public 
    {
        require(msg.sender==R6Address,'You do not have permission');
        subContract.withdrawal_lp(to,amount);

    }

    function setAutomatedMarketMakerPair(address pair, bool value) public onlyOwner {
        require(pair != uniswapPair, "The PancakeSwap pair cannot be removed from automatedMarketMakerPairs");
        _setAutomatedMarketMakerPair(pair, value);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        require(automatedMarketMakerPairs[pair] != value, "Automated market maker pair is already set to that value");
        automatedMarketMakerPairs[pair] = value;
        emit SetAutomatedMarketMakerPair(pair, value);
    }

     function _spendAllowance(
        address owner,
        address spender,
        uint256 amount
    ) internal override {
        uint256 currentAllowance = allowance(owner, spender);

        console.log(owner,spender);
        if (currentAllowance != type(uint256).max) {
            require(currentAllowance >= amount, "ERC202: insufficient allowance");
            unchecked {
                _approve(owner, spender, currentAllowance - amount);
            }
        }
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(!_isBlacklisted[from] && !_isBlacklisted[to], "Blacklisted address");
        // require(allowance(from,msg.sender)>0 , "allowance error ");
        if(amount == 0) {
            super._transfer(from, to, 0);
            return;
        } 

        bool takeFee = true;

        // if any account belongs to _isExcludedFromFee account then remove the fee
        if(_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }


        // console.log('_uniswapV2Pair',uniswapPair);
        // console.log('automatedMarketMakerPairs[from]',automatedMarketMakerPairs[from]);
        // console.log('automatedMarketMakerPairs[to]',automatedMarketMakerPairs[to]);

        // console.log('takeFee11',takeFee);
        // console.log('sender',msg.sender);
        // console.log('tokensub',address(subContract));
        // console.log('token',address(this));
        // console.log('from.balance',balanceOf(from));
        // console.log('from',from); 
        // console.log('to',to);
        // console.log('amount',amount); 

            console.log('tran',from,to,amount);
         if(automatedMarketMakerPairs[from] ){
                console.log(takeFee==false);
                console.log('=====automatedMarketMakerPairs[from]) Buy=======');
                require(takeFee==false,'buy is off');

                // uint256 fees=_distributeToken(from,amount);
                // amount = amount.sub(fees);

                // console.log('cost buy fee1',fees,amount);
            }

        if(takeFee ) {
            // console.log('amount',amount); 
            //手续费
            {
                uint256 fees=_distributeFeeToken(from,amount);
                amount = amount.sub(fees);
                console.log('cost fee',fees,amount);
            }

            if(automatedMarketMakerPairs[to]){     
                console.log('=====automatedMarketMakerPairs[to]) Sell=======');

                uint256 fees=_distributeToken(from,amount);
                amount = amount.sub(fees);
                console.log('cost sell fee1',fees,amount);
                subContract.release(amount);
            }
       }
        super._transfer(from, to, amount);
    }

    function release() public 
    {
        // subContract.release();
    }

    function _distributeFeeToken(address from,uint256 amount) private returns(uint256) {
        uint256 fees;

        console.log('_distributeFeeToken',from,amount);
        {    
            uint256 feeAmount = amount.mul(R2Fee).div(10000);           
            super._transfer(from, R2Address, feeAmount); 
            fees=fees.add(feeAmount);
        }   

        return fees;
    }  

    function _distributeToken(address from,uint256 amount) private returns(uint256) {
        uint256 fees;

        {    
            uint256 feeAmount = amount.mul(R3Fee).div(10000);           
            super._transfer(from, R3Address, feeAmount); 
            fees=fees.add(feeAmount);
        }



        return fees;
    } 


}"
